INSERT INTO produtos VALUES (26, 1, 3, 4, 'Para Intel Pentium 4 e Celeron', '<META content="Microsoft FrontPage 4.0" name=GENERATOR>\r\n<META content=FrontPage.Editor.Document name=ProgId>\r\n<STYLE type=text/css>\r\nBODY {	BACKGROUND-COLOR: #ffffff; COLOR: #000000; FONT-FAMILY: Verdana, Arial, Helvetica, sans-serif; FONT-SIZE: 11px;}\r\nA:link { COLOR: #003399; TEXT-DECORATION: none }\r\nA:visited { COLOR: #003399; TEXT-DECORATION: none }\r\nA:hover { COLOR: red; TEXT-DECORATION: underline }\r\n.text { FONT-SIZE: 11px; COLOR: black; FONT-FAMILY: Arial }\r\n.label { FONT-WEIGHT: bold; FONT-SIZE: 11px; COLOR: black; FONT-FAMILY: arial; TEXT-DECORATION: none }\r\nA.label:visited { FONT-WEIGHT: bold; FONT-SIZE: 11px; COLOR: black; FONT-FAMILY: arial; TEXT-DECORATION: none }\r\nA.label:link { FONT-WEIGHT: bold; FONT-SIZE: 11px; COLOR: black; FONT-FAMILY: arial; TEXT-DECORATION: none }\r\nA.label:hover { FONT-WEIGHT: bold; FONT-SIZE: 11px; COLOR: #006C74; FONT-FAMILY: arial; TEXT-DECORATION: none }\r\n.titatrib { FONT-SIZE: 14px; COLOR: black; FONT-FAMILY: verdana; LETTER-SPACING: -1px; FONT-WEIGHT: bold }\r\nA.titatrib:link { FONT-SIZE: 14px; COLOR: black; FONT-FAMILY: Verdana; LETTER-SPACING: -1px; TEXT-DECORATION: none; FONT-WEIGHT: bold }\r\nA.titatrib:visited { FONT-SIZE: 14px; COLOR: black; FONT-FAMILY: Verdana; LETTER-SPACING: -1px; TEXT-DECORATION: none; FONT-WEIGHT: bold }\r\nA.titatrib:hover { FONT-SIZE: 14px; COLOR: red; FONT-FAMILY: Verdana; LETTER-SPACING: -1px; TEXT-DECORATION: none; FONT-WEIGHT: bold }\r\n\r\n\r\n</STYLE>\r\n<!-- END OF PRODUCTDETAILS --><!-- END OF PRODUCTDETAILS -->\r\n<TABLE cellSpacing=0 cellPadding=0 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD><A name=topomenu></A><BR>\r\n<TABLE cellSpacing=0 cellPadding=0 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD><IMG height=17 src="images/title_saiba_mais.gif" width=113 align=left></TD></TR>\r\n<TR>\r\n<TD class=label background=images/bg_label.gif height=24><IMG height=1 src="images/spacer_trans.gif" width=10> <A class=label href="#especificacoes">Especificações</A>&nbsp;|&nbsp;&nbsp;<A class=label href="#requisitos">Requisitos</A>&nbsp;|&nbsp;&nbsp;<A class=label href="#dadostecnicos">Dados Técnicos</A>&nbsp;</TD></TR></TBODY></TABLE></TD>\r\n<TR>\r\n<TD><A name=especificacoes></A><BR>\r\n<TABLE cellSpacing=0 cellPadding=0 width="100%" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD><IMG height=22 src="images/label_especificacoes_on.gif" width=97 border=0></TD>\r\n<TD class=label align=right width="100%" background=images/label_bg.gif><A href="#topomenu"><IMG height=19 src="images/bot_voltartopo.gif" width=112 border=0 valign="bottom"></A></TD></TR></TBODY></TABLE><BR></TD></TR>\r\n<TR>\r\n<TD class=text>\r\n<P align=center><B><FONT face=Verdana color=#008080 size=2>PLACA MÃE INTEL D845 EPT2</FONT></B></P>\r\n<UL>\r\n<LI><FONT face=Verdana size=1><B>Processador: </B>Intel Pentium 4</FONT><FONT class=medcopy face=Verdana size=2><SUP>®</SUP></FONT><FONT face=Verdana size=1> / Intel Celeron</FONT><FONT class=medcopy face=Verdana size=2><SUP>®<BR></SUP></FONT>\r\n<LI><FONT face=Verdana size=1><B>Memória: </B>2 sockets 184 pinos DDR SDRAM com suporte para até 2 GB.<BR></FONT>\r\n<LI><FONT face=Verdana size=1><B>Chipset: </B><FONT class=medcopy>Intel</FONT></FONT><FONT class=medcopy face=Verdana size=2><SUP>®</SUP></FONT><FONT face=Verdana size=1><FONT class=medcopy> 845E Chipset<BR></FONT></FONT>\r\n<LI><FONT face=Verdana size=1><B>Som Onboard: </B><FONT class=medcopy>Audio subsystem for AC \'97<BR></FONT></FONT>\r\n<LI><FONT face=Verdana size=1><B>Slots:</B> 3 PCI e 1 AGP (1.5 V 4x)<BR></FONT>\r\n<LI><FONT face=Verdana size=1><B>Periféricos:</B> 4 portas USB 2.0 (upgrade para 6 portas), 2 portas serial, 1 porta paralela, 2 IDE\'s com Ultra DMA 33 e suporte a ATA-66/100, 1 conector de disquete, Portas PS/2 para mouse e teclado, 3 conectores para cooler<BR></FONT>\r\n<LI><FONT face=Verdana size=1><B>Fonte de Alimentação ATX específica para Pentium 4<BR></B></FONT>